import React, { useState } from 'react';
import '../styles/HealthCheck.css';

const HealthCheckForm = ({ onSubmit, initialData, isEdit = false }) => {
  const [formData, setFormData] = useState(
    initialData || {
      name: '',
      description: '',
      url: '',
      interval_days: 0,
      interval_hours: 0,
      interval_minutes: 5,
      grace_days: 0,
      grace_hours: 0,
      grace_minutes: 5,
      notify_email: '',
      notify_webhook: '',
      response_time_threshold: 1000,
      is_active: true
    }
  );

  const [errors, setErrors] = useState({});
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleNumberChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: parseInt(value) || 0
    }));
  };

  const validateForm = () => {
    const newErrors = {};

    if (!formData.name.trim()) {
      newErrors.name = 'Name is required';
    }

    if (formData.interval_days === 0 && 
        formData.interval_hours === 0 && 
        formData.interval_minutes === 0) {
      newErrors.interval = 'At least one interval value must be greater than 0';
    }

    if (formData.notify_email && !/^\S+@\S+\.\S+$/.test(formData.notify_email)) {
      newErrors.notify_email = 'Invalid email format';
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!validateForm()) return;

    setIsSubmitting(true);

    try {
      await onSubmit(formData);
    } catch (error) {
      console.error('Error submitting form:', error);
      setErrors({ form: 'Failed to submit form. Please try again.' });
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <form className="health-check-form" onSubmit={handleSubmit}>
      {errors.form && <div className="error-message">{errors.form}</div>}

      <div className="form-section">
        <h3>Basic Information</h3>

        <div className="form-group">
          <label htmlFor="name">Name *</label>
          <input
            type="text"
            id="name"
            name="name"
            value={formData.name}
            onChange={handleChange}
            className={errors.name ? 'error' : ''}
          />
          {errors.name && <div className="error-message">{errors.name}</div>}
          <small>A descriptive name for this health check</small>
        </div>

        <div className="form-group">
          <label htmlFor="description">Description</label>
          <textarea
            id="description"
            name="description"
            value={formData.description}
            onChange={handleChange}
            rows="3"
          />
          <small>Optional details about what this health check monitors</small>
        </div>

        <div className="form-group">
          <label htmlFor="url">URL</label>
          <input
            type="url"
            id="url"
            name="url"
            value={formData.url}
            onChange={handleChange}
          />
          <small>Optional URL to be monitored</small>
        </div>

        <div className="form-group">
          <label htmlFor="is_active">Status</label>
          <div className="checkbox-wrapper">
            <input
              type="checkbox"
              id="is_active"
              name="is_active"
              checked={formData.is_active}
              onChange={handleChange}
            />
            <label htmlFor="is_active" className="checkbox-label">Active</label>
          </div>
          <small>Whether this health check is currently active</small>
        </div>
      </div>

      <div className="form-section">
        <h3>Timing Settings</h3>

        <div className="form-row">
          <div className="form-group">
            <label htmlFor="interval_days">Interval (Days)</label>
            <input
              type="number"
              id="interval_days"
              name="interval_days"
              value={formData.interval_days}
              onChange={handleNumberChange}
              min="0"
            />
          </div>

          <div className="form-group">
            <label htmlFor="interval_hours">Hours</label>
            <input
              type="number"
              id="interval_hours"
              name="interval_hours"
              value={formData.interval_hours}
              onChange={handleNumberChange}
              min="0"
            />
          </div>

          <div className="form-group">
            <label htmlFor="interval_minutes">Minutes</label>
            <input
              type="number"
              id="interval_minutes"
              name="interval_minutes"
              value={formData.interval_minutes}
              onChange={handleNumberChange}
              min="0"
            />
          </div>
        </div>
        {errors.interval && <div className="error-message">{errors.interval}</div>}
        <small>How often this health check should be pinged</small>

        <div className="form-row">
          <div className="form-group">
            <label htmlFor="grace_days">Grace Period (Days)</label>
            <input
              type="number"
              id="grace_days"
              name="grace_days"
              value={formData.grace_days}
              onChange={handleNumberChange}
              min="0"
            />
          </div>

          <div className="form-group">
            <label htmlFor="grace_hours">Hours</label>
            <input
              type="number"
              id="grace_hours"
              name="grace_hours"
              value={formData.grace_hours}
              onChange={handleNumberChange}
              min="0"
            />
          </div>

          <div className="form-group">
            <label htmlFor="grace_minutes">Minutes</label>
            <input
              type="number"
              id="grace_minutes"
              name="grace_minutes"
              value={formData.grace_minutes}
              onChange={handleNumberChange}
              min="0"
            />
          </div>
        </div>
        <small>Time to wait before marking a check as down</small>
      </div>

      <div className="form-section">
        <h3>Notification Settings</h3>

        <div className="form-group">
          <label htmlFor="notify_email">Email Notification</label>
          <input
            type="email"
            id="notify_email"
            name="notify_email"
            value={formData.notify_email}
            onChange={handleChange}
            className={errors.notify_email ? 'error' : ''}
          />
          {errors.notify_email && <div className="error-message">{errors.notify_email}</div>}
          <small>Send notification to this email (optional)</small>
        </div>

        <div className="form-group">
          <label htmlFor="notify_webhook">Webhook URL</label>
          <input
            type="url"
            id="notify_webhook"
            name="notify_webhook"
            value={formData.notify_webhook}
            onChange={handleChange}
          />
          <small>Send notification to this webhook (optional)</small>
        </div>

        <div className="form-group">
          <label htmlFor="response_time_threshold">Response Time Threshold (ms)</label>
          <input
            type="number"
            id="response_time_threshold"
            name="response_time_threshold"
            value={formData.response_time_threshold}
            onChange={handleNumberChange}
            min="0"
          />
          <small>Maximum acceptable response time in milliseconds</small>
        </div>
      </div>

      <div className="form-actions">
        <button 
          type="submit" 
          className="btn btn-primary" 
          disabled={isSubmitting}
        >
          {isSubmitting ? 'Saving...' : isEdit ? 'Update Health Check' : 'Create Health Check'}
        </button>
      </div>
    </form>
  );
};

export default HealthCheckForm;
